    const { title , data } = props;
    if(typeof data == 'undefined')
        return null;

        console.log("deneme");
        console.log(title);
        console.log(data);

    return(
        <React.Fragment>
          <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src={data.PosterArt.url} />
  <Card.Body>
   
    <Card.Text>
     {title}
    </Card.Text>
    {/* <Button variant="primary">Go somewhere</Button> */}
  </Card.Body>
</Card>
